import { Link } from "react-router-dom";

const NavBar = () => {
    return ( 
        <nav>
            <Link href="/HomePage">Home</Link>
            <li><a href="contact.asp">Contact</a></li>
            <li><a href="about.asp">About</a></li>
            </nav>
     );
}
 
export default NavBar;
